import React from 'react';
import Navbar from './Navbar/Navbar';
import './Index.css';
import Profile from './Profile/Profile';
import About from './About/About';
import Skills from './Skills/Skills';

function Portfolio() {
  return (
    <>
    <Navbar/>
    <Profile/>
    <About/>
    <Skills/>
    </>
  )
}

export default Portfolio
